import React, { Component } from 'react';

class AddTopicos extends Component {



    render() { 
        return ( 
            <div className = "addTopicos">
                <h2>Tela de adição de tópicos</h2>
            <form className = "addForm">
                <label for="materia">Materia:</label>
                <input type="text" id="materia" name="materia"/>
                <label for="assunto">Assunto:</label>
                <input type="text" id="assunto" name="assunto"/>
                <label for="topico">Topico:</label>
                <input type="text" id="topico" name="topico"/>
                <label for="preReq">Pré-Requisitos:</label>
                <input type="text" id="preReq" name="preReq"/>
                <input className = "submitBtn" type="submit" value="Submit"/>
            </form>
            </div>
         );
    }
}

export default AddTopicos;
